jQuery(document).ready(function($){var Gwen={init:function(){$(".menu-toggle, .sidebar-toggle").on("click",this.toggleArea)},toggleArea:function(e){e.preventDefault();if($(this).attr("aria-expanded")=="false"){$(this).attr("aria-expanded","true");$(this).next().addClass("toggled")}else{$(this).attr("aria-expanded","false");$(this).next().removeClass("toggled")}}};Gwen.init()});